import React from 'react';
class App extends React.Component {
    
}
 
function Adminpage() {
  return (
    <div>
      <h>You can add the question paper from here</h>
      Upload Question Paper.
      <input type="file"onChange={(e)=> this.upload(e)} name="img" />    
    </div>
  );
}
 
export default Adminpage;
